def get_priority_score(char):
    asc = ord(char)
    if asc > 91:
        return asc - 96
    if asc < 96:
        return asc - 38


def get_priority(c1, c2):
    for c in c1:
        if c in c2:
            asc = get_priority_score(c)
            return asc

    return False


